(79, 'widget_text', 'a:4:{i:1;a:0:{}i:2;a:3:{s:5:"title";s:0:"";s:4:"text";s:162:"<img src="http://localhost:808/techwebv2/wp-content/uploads/2017/05/logo-tech-footer.png" alt="" width="190" height="81" class="alignnone size-full wp-image-9" />";s:6:"filter";b:0;}i:3;a:3:{s:5:"title";s:11:"Conócenos!";s:4:"text";s:780:"TECH ID Solutions International Group es una empresa líder en el desarrollo de soluciones a medida para pequeñas y grandes empresas a nivel mundial.\r\n\r\nLa experiencia de TECH ID Solutions en el análisis de nuevas soluciones a medida ha generado un grupo de profesionales que permite abarcar diferentes tipos de proyectos, mejorando los procesos tecnológicos de las empresas y dando un servicio completo a los clientes desde una idea hasta la ejecución final del proyecto.\r\n\r\nLa metodología de trabajo que ha desarrollado la empresa permite no solo la consecución de los objetivos planteados por nuestros clientes sino que unos costes menores y una mayor flexibilidad en los procedimientos.\r\n\r\nSu presencia internacional incluye Europa y América.\r\n\r\nConéctate con nosotros";s:6:"filter";b:0;}s:12:"_multiwidget";i:1;}', 'yes'),
