a de la formación, TECH ID Solutions ofrece formación en tres niveles:</p>\n<ul>\n<li style="text-align: left;">• In-Company: Formación dentro de tú propia empresa y hecha a tú medida.</li>\n<li style="text-align: left;">• E-learning: Aprende desde cualquier sitio y en cualquier momento.</li>\n<li style="text-align: left;">• Mixta: Prepara para aquellas temáticas donde es necesaria la mezcla de la formación presencial y a distancia.</li>\n</ul>\n								</div><!--.info-->	\r\n							</div>\r\n						</div>\r\n					\r\n								\r\n	</div></div></div></div><div id="pg-99-1"  class="panel-grid panel-has-style"  data-style="{&quot;background_display&quot;:&quot;tile&quot;,&quot;cell_alignment&quot;:&quot;flex-start&quot;,&quot;align&quot;:&quot;&quot;,&quot;column_padding&quot;:&quot;&quot;}" ><div style="padding: 100px 0; " class="panel-row-style panel-row-style-for-99-1" ><div id="pgc-99-1-0"  class="panel-grid-cell"  data-weight="1" ><div id="panel-99-1-0-0" class="so-panel widget widget_sydney_portfolio sydney_portfolio_widget panel-first-child panel-last-child" data-index="1" data-style="{&quot;padding&quot;:&quot;5px 5px 5px 5px&quot;,&quot;mobile_padding&quot;:&quot;2px 2px 2px 2px&quot;,&quot;background_image_attachment&quot;:&quot;73&quot;,&quot;background_display&quot;:&quot;parallax&quot;}" ><div data-siteorigin-parallax="{&quot;backgroundUrl&quot;:&quot;http:\\/\\/localhost:808\\/techwebv2\\/wp-content\\/uploads\\/2017\\/05\\/576662-copia.jpg&quot;,&quot;backgroundSize&quot;:[2808,1872],&quot;backgroundSizing&quot;:&quot;scaled&quot;,&quot;limitMotion&quot;:&quot;auto&quot;}" class="panel-widget-style panel-widget-style-for-99-1-0-0" ><h3 class="widget-title">Proyectos</h3><div class="project-wrap"><div class="roll-project fullwidth"><div class="isotope-container" data-portfolio-effect="fadeInUp"><div class="project-item item isotope-item "><a class="project-pop-wrap" href="http://localhost:808/techwebv2/index.php/projects/novo-e-pay/"><div class="project-pop