(109, 1, '2017-05-14 21:12:48', '2017-05-14 21:12:48', '<div id="pl-109"  class="panel-layout" ><div id="pg-109-0"  class="panel-grid panel-has-style" ><div style="padding: 100px 0; " class="panel-row-style panel-row-style-for-109-0" ><div id="pgc-109-0-0"  class="panel-grid-cell"  data-weight="1" ><div id="panel-109-0-0-0" class="so-panel widget widget_sydney_services_type_a sydney_services_widget panel-first-child panel-last-child" data-index="0" data-style="{&quot;background_display&quot;:&quot;tile&quot;}" >			\r\n																													<div class="service col-md-4">\r\n													<div class="roll-icon-box">\r\n											\r\n									<div class="icon">\r\n																					<i class="fa fa-pencil"></i>																			</div>\r\n																<div class="content">\r\n									<h3>\r\n																					SOLUCIONES A MEDIDA																			</h3>\r\n									<p>Análisis de las necesidades del cliente, desarrollo de una solución a medida y seguimiento de su buena aplicación.</p>\n								</div><!--.info-->	\r\n							</div>\r\n						</div>\r\n																													<div class="service col-md-4">\r\n													<div class="roll-icon-box">\r\n											\r\n									<div class="icon">\r\n																					<i class="fa fa-code"></i>																			</div>\r\n																<div class="content">\r\n									<h3>\r\n																					SOFTWARE																			</h3>\r\n									<p>Ahorro y flexibilidad para el cliente. TECH ID Solutions ofrece la posibilidad a sus clientes de tener tantos desarrolladores como necesite en cada momento y según sus necesidades puntuales.</p>\n								</div><!--.info-->	\r\n							</div>\r\n						</div>\r\n																													<div class="service col-md-4">\r\n													<div class="roll-icon-box">\r\n											\r\n									<div class="icon">\r\n																					<i class="fa fa-lock"></i>																			</div>\r\n																<div class="content">\r\n									<h3>\r\n																					BIG DATA																			</h3>\r\n									<p>Desde TECH ID Solutions somos conscientes de la importancia de la gestión de los datos y de cómo obtener el mayor aprovechamientos de estos, transformando los datos en Información útil, por eso ofrecemos soluciones hechas para mejorar el rendimiento de la información.</p>\n								</div><!--.info-->	\r\n							</div>\r\n						</div>\r\n																													<div class="service col-md-4">\r\n													<div class="roll-icon-box">\r\n											\r\n									<div class="icon">\r\n																					<i class="fa fa-cogs"></i>																			</div>\r\n																<div class="content">\r\n									<h3>\r\n																					AUTOMATIZACIÓN DE PROCESOS																			</h3>\r\n									<p>Mediante el análisis del funcionamiento de los procesos de la empresa,TECH ID Solutions presenta una solución personalizada mejornado el proceso.</p>\n								</div><!--.info-->	\r\n							</div>\r\n						</div>\r\n																													<div class="service col-md-4">\r\n													<div class="roll-icon-box">\r\n											\r\n									<div class="icon">\r\n																					<i class="fa fa-signal"></i>																			</div>\r\n																<div class="content">\r\n									<h3>\r\n																					MONITORIZACIÓN																			</h3>\r\n									<p>TECH ID Solutions es consciente de la importancia que tienen las IT dentro de las empresas y por eso ofrece un servicio de monitorización 24&#215;7 de las constantes de las empresas y auditorías de seguridad.</p>\n								</div><!--.info-->	\r\n							</div>\r\n						</div>\r\n																													<div class="service col-md-4">\r\n													<div class="roll-icon-box">\r\n											\r\n									<div class="icon">\r\n																					<i class="fa fa-leanpub"></i>																			</div>\r\n																<div class="content">\r\n									<h3>\r\n																					FORMACIÓN																			</h3>\r\n									<p>Conscientes de la importancia de la formación, TECH ID Solutions ofrece formación en tres niveles:</p>\n<ul>\n<li style="text-align: left;">• In-Company: Formación dentro de tú propia empresa y hecha a tú medida.</li>\n<li style="text-align: left;">• E-learning: Aprende desde cualquier sitio y en cualquier momento.</li>\n<li style="text-align: left;">• Mixta: Prepara para aquellas temáticas donde es necesaria la mezcla de la formación presencial y a distancia.</li>\n</ul>\n								</div><!--.info-->	\r\n							</div>\r\n						</div>\r\n					\r\n								\r\n	</div></div></div></div><div id="pg-109-1"  class="panel-grid panel-has-style"  data-style="{&quot;background_display&quot;:&quot;tile&quot;,&quot;cell_alignment&quot;:&quot;flex-start&quot;,&quot;align&quot;:&quot;&quot;,&quot;column_padding&quot;:&quot;&quot;}" ><div style="padding: 100px 0; " class="panel-row-style panel-row-style-for-109-1" ><div id="pgc-109-1-0"  class="panel-grid-cell"  data-weight="1" ><div id="panel-109-1-0-0" class="so-panel widget widget_sydney_portfolio sydney_portfolio_widget panel-first-child panel-last-child" data-index="1" data-style="{&quot;padding&quot;:&quot;5px 5px 5px 5px&quot;,&quot;mobile_padding&quot;:&quot;2px 2px 2px 2px&quot;,&quot;background_image_attachment&quot;:&quot;73&quot;,&quot;background_display&quot;:&quot;parallax&quot;}" ><div data-siteorigin-parallax="{&quot;backgroundUrl&quot;:&quot;http:\\/\\/localhost:808\\/techwebv2\\/wp-content\\/uploads\\/2017\\/05\\/576662-copia.jpg&quot;,&quot;backgroundSize&quot;:[2808,1872],&quot;backgroundSizing&quot;:&quot;scaled&quot;,&quot;limitMotion&quot;:&quot;auto&quot;}" class="panel-widget-style panel-widget-style-for-109-1-0-0" ><h3 class="widget-title">Proyectos</h3><div class="project-wrap"><div class="roll-project fullwidth"><div class="isotope-container" data-portfolio-effect="fadeInUp"><div class="project-item item isotope-item "><a class="project-pop-wrap" href="http://localhost:808/techwebv2/index.php/projects/novo-e-pay/"><div class="