(164, 1, '2017-05-15 03:17:03', '2017-05-15 03:17:03', '<div id="pl-160"  class="panel-layout" ><div id="pg-160-0"  class="panel-grid panel-has-style"  data-style="{&quot;background_display&quot;:&quot;tile&quot;,&quot;cell_alignment&quot;:&quot;flex-start&quot;,&quot;align&quot;:&quot;&quot;,&quot;column_padding&quot;:&quot;&quot;}" ><div style="padding: 100px 0; " class="panel-row-style panel-row-style-for-160-0" ><div id="pgc-160-0-0"  class="panel-grid-cell"  data-weight="1" ><div id="panel-160-0-0-0" class="so-panel widget widget_text panel-first-child panel-last-child" data-index="0" data-style="{&quot;background_display&quot;:&quot;tile&quot;}" ><h3 class="widget-title">BPO Y FACTORÍA</h3>			<div class="textwidget">Nuestra empresa esta especializada en BPO como servicio empresarial de calidad y eficiencia en costes. Para ello analizamos las necesidades del cliente y sus procesos de negocio con el objetivo de implatar la metodología más adecuada para la automatización de los procesos, así como su gestión y control en tiempo y en calidad.\n\nPoseemos un área de "BPO en sistemas de información" que trabaja en modalidad de "Factoría de Software" cubriendo, en función de la necesidad de cliente, la totalidad o la parte el ciclo de desarrollo del software que se requiera. Para ello se cuenta con un equipo especializado en la gestión de proyectos, en la implantación de metodologías de trabajo distribuido cliente-proveedor, en el desarrollo informático en modalidad factoría, en el control de calidad y testeo, etc.\n\nDe igual forma, disponemos de otra área en "BPO en automatización de procesos mercantiles" cuya misión es conseguir que el cliente pueda optimizar elevadas cargas de trabajo administrativas y empresariales con una óptimo grado de respuesta en calidad y tiempo a costes de producción competitivos. Para ello, se trabaja en el análisis y definición del work-flow más adecuado para cada proceso, el mapa de procesos y la parametrización y automatización de acciones que se adecuen las actividad empresarial externalizada. Se predente poder cubrir bien un ciclo completo de un proceso, así como las adeucación de aquellas partes del ciclo que considere el cliente que pueden trabajarse de forma independiente y que les permitirá mejorar su grado de eficiencia y rentabilidad.</div>\n		</div></div></div></div></div>', 'BPO Y FACTORÍA', '', 'inherit', 'closed', 'closed', '', '160-revision-v1', '', '', '2017-05-15 03:17:03', '2017-05-15 03:17:03', '', 160, 'http://localhost:808/techwebv2/index.php/2017/05/15/160-revision-v1/', 0, 'revision', '', 0),
