(179, 1, '2017-05-15 03:46:55', '2017-05-15 03:46:55', '<img style="margin-right: 10px; float: left;" src="http://localhost:808/techwebv2/wp-content/uploads/2017/05/10380251_10152487123287456_6908663300090700140_o-300x188.jpg" alt="" width="300" height="188" class="alignnone size-medium wp-image-182" /><p align="justify">Nace promovida y financiada, en el marco de la política de Responsabilidad Social Corporativa del grupo, con el compromiso de potenciar los valores positivos de la innovación tecnológica y también preocupados por minimizar los efectos adversos que en la sociedad puedan tener los avances tecnológicos. Deseamos promover una innovación inclusiva, una innovación que empodere a la ciudadanía y que transmita valores de transparencia y, sobre todo, que impulse modelos cooperativos, colaborativos y de innovación abierta en la que desde Tech ID Group creemos firmemente como mejor fórmula para avazar como sociedad.\r\n\r\nPor tanto, el objetivo de la Catedrá será promover un foro riguroso de análisis, estudio y debate sobre las tendencias de la innovación tecnológica en el ámbito de la empresa, de las Administraciones Públicas y de la sociedad en su conjunto. Por ello, la Cátedra se convertirá en un instrumento que promueva conferencias, seminarios, paneles de discusión de expertos, etc. De igual forma, se potenciará la divulgación y difusión cientifico-técnica mediante publicaciones de artículos, libros y guías de buenas prácticas.\r\n\r\nEn función de la presente concepción de la Cátedra por parte de nuestro grupo empresarial, hemos considerado que la mejor persona que podría dirigirla es el Dr. Luis Joyanes Aguilar pues auna en su persona los rasgos que desamos resaltar y poner en valor. Su dilatada trayectoría profesional como profesor de universidad, como informático, como sociólogo, como escritor, etc. le avalan para potenciar al máximo la misión de la Cátedra de Innovación Tecnológica Tech ID.</p>', 'Cátedra de Innovación Tecnológica Tech ID', '', 'publish', 'closed', 'closed', '', 'catedra-de-innovacion-tecnologica-tech-id', '', '', '2017-05-15 03:55:09', '2017-05-15 03:55:09', '', 0, 'http://localhost:808/techwebv2/?page_id=179', 0, 'page', '', 0),
