(190, 1, '2017-05-15 03:58:57', '2017-05-15 03:58:57', '<img style="margin-right: 20px; float: left;" src="http://localhost:808/techwebv2/wp-content/uploads/2017/05/workplace-1245776_640-300x200.jpg" alt="" width="300" height="200" class="alignnone size-medium wp-image-191" />\r\n<p align="justify">TECH ID Group es una empresa líder en el desarrollo de soluciones a medida para pequeñas y grandes empresas a nivel mundial.\r\n\r\nLa experiencia de TECH ID Solutions en el análisis de nuevas soluciones a medida ha generado un grupo de profesionales que permite abarcar diferentes tipos de proyectos, mejorando los procesos tecnológicos de las empresas y dando un servicio completo a los clientes desde una idea hasta la ejecución final del proyecto.\r\n\r\nLa metodología de trabajo que ha desarrollado la empresa permite no solo la consecución de los objetivos planteados por nuestros clientes sino que unos costes menores y una mayor flexibilidad en los procedimientos.\r\n\r\nSu presencia internacional incluye Europa y América.</p>', 'Quienes Somos', '', 'publish', 'closed', 'closed', '', 'quienes-somos', '', '', '2017-05-15 04:31:41', '2017-05-15 04:31:41', '', 0, 'http://localhost:808/techwebv2/?page_id=190', 0, 'page', '', 0),
